import React from 'react';
import Container from './component/HOC/Container';
import {
    BrowserRouter as Router,
    Switch,
    Route,
  } from "react-router-dom";
import Home from './pages/Home';

function App() {
    return (
        <Router>
            <Switch>
                <Container>
                    <div>
                        <Route exact path="/" component={Home} />
                    </div>
                </Container>
            </Switch>
        </Router>
    )
}

export default App
